<?phpnamespace App\Entity;use App\Repository\PieceRepository;use Doctrine\ORM\Mapping as ORM;/** * @ORM\Entity(repositoryClass=PieceRepository::class) */class Piece{    /**     * @ORM\Id     * @ORM\GeneratedValue     * @ORM\Column(type="integer")     */    private $id;    /**     * @ORM\Column(type="string", length=255)     */    private $libelle;    /**     * @ORM\Column(type="string", length=255)     */    private $path;    /**     * @ORM\Column(type="datetime")     */    private $dateTransmission;    /**     * @ORM\ManyToOne(targetEntity=Dossier::class, inversedBy="pieces")     */    private $dossier;    /**     * @ORM\ManyToOne(targetEntity=Client::class, inversedBy="pieces")     */    private $client;    public function getId(): ?int    {        return $this->id;    }    public function getLibelle(): ?string    {        return $this->libelle;    }    public function setLibelle(string $libelle): self    {        $this->libelle = $libelle;        return $this;    }    public function getPath(): ?string    {        return $this->path;    }    public function setPath($path): self    {        if (!is_null($path)){            $this->path = $path;        }        return $this;    }    public function getDateTransmission(): ?\DateTimeInterface    {        return $this->dateTransmission;    }    public function setDateTransmission(\DateTimeInterface $dateTransmission): self    {        $this->dateTransmission = $dateTransmission;        return $this;    }    public function getDossier(): ?Dossier    {        return $this->dossier;    }    public function setDossier(?Dossier $dossier): self    {        $this->dossier = $dossier;        return $this;    }    public function getClient(): ?Client    {        return $this->client;    }    public function setClient(?Client $client): self    {        $this->client = $client;        return $this;    }}